/* name: get
 * function() */
static int lcf2_get(lua_State *L) {
  enum { lc_nformalargs = 0 };
  lua_settop(L, 0);

  /* ASSERT(not eof()) */
  lc_getupvalue(L, lua_upvalueindex(1), 20, 95);
  lc_getupvalue(L, lua_upvalueindex(1), 0, 183);
  lua_call(L, 0, 1);
  lua_pushboolean(L, !(lua_toboolean(L, -1)));
  lua_remove(L, -2);
  lua_call(L, 1, 0);
  assert(lua_gettop(L) == 0);

  /* local ret = state_const:sub(state + 1, state + 1) */
  lc_getupvalue(L, lua_upvalueindex(1), 0, 185);
  lua_pushliteral(L, "sub");
  lua_gettable(L, -2);
  lua_insert(L, -2);
  lc_getupvalue(L, lua_upvalueindex(1), 0, 184);
  lua_pushnumber(L, 1);
  lc_add(L, -2, -1);
  lua_remove(L, -2);
  lua_remove(L, -2);
  lc_getupvalue(L, lua_upvalueindex(1), 0, 184);
  lua_pushnumber(L, 1);
  lc_add(L, -2, -1);
  lua_remove(L, -2);
  lua_remove(L, -2);
  lua_call(L, 3, 1);
  assert(lua_gettop(L) == 1);

  /* state = state + 1 */
  lc_getupvalue(L, lua_upvalueindex(1), 0, 184);
  lua_pushnumber(L, 1);
  lc_add(L, -2, -1);
  lua_remove(L, -2);
  lua_remove(L, -2);
  lc_setupvalue(L, lua_upvalueindex(1), 0, 184);
  assert(lua_gettop(L) == 1);

  /* return ret */
  lua_pushvalue(L, 1);
  return 1;
  assert(lua_gettop(L) == 1);
}

